const routes: Routes = [
  {
    path:"",
    component:BodyComponent,
  },
  {
    path:"search/:params",
    component:SearchComponent
  },
  {
    path:"search/:params",
    redirectTo:"search/:params",
    pathMatch:"full"
  }






];

